<script>
	//app
	import { goto, stores } from '@sapper/app';
	import { onMount, onDestroy } from 'svelte';

	//global Store
	import sUser from '../stores/user.js';
	
	// Banner parallax
	function parallax(e) {
		let _w = window.innerWidth/2;
		let _h = window.innerHeight/2;
		let _mouseX = e.clientX;
		let _mouseY = e.clientY;
		let _depth1 = `${50 - (_mouseX - _w) * 0.01}% ${78 - (_mouseY - _h) * 0.01}%`;
		let _depth2 = `${50 - (_mouseX - _w) * 0.02}% ${78 - (_mouseY - _h) * 0.02}%`;
		let _depth3 = `${50 - (_mouseX - _w) * 0.06}% ${78 - (_mouseY - _h) * 0.06}%`;
		let x = `${_depth3}, ${_depth2}, ${_depth1}`;
		
		e.currentTarget.style.backgroundPosition = x;
	}
	
	//set user BG image
	let background;
	$: if ($sUser) {
		if ($sUser.profileImg !== '') {
			background = `background-image: url("${$sUser.profileImg.replace(/_normal/,'_400x400')}")`;
		} else {
			background = '';
		}
	}
</script>


<header id="parallax" class="relative h-24 rounded-t-lg" on:mousemove="{parallax}">
	<!-- Social Icons -->
	<ul class="socialList absolute bottom-0 left-0 -mb-6 flex ml-32">
		<li class="mr-2"><img src="/img/ico/youtube.svg" alt="youtube" /></li>
		<li class="mr-2"><img src="/img/ico/twitch.svg" alt="twitch" /></li>
		<li class="mr-2"><img src="/img/ico/instagram.svg" alt="instagram" /></li>
		<li class="mr-2"><img src="/img/ico/facebook.svg" alt="facebook" /></li>
	</ul>
	<!-- xSocial Icons -->
	
	<!-- Avatar and Active Social ico -->
	<div style="{background}" class="avatar absolute h-24 w-24 rounded-full mx-auto bottom-0 left-0 -mb-12 ml-3">
		<div class="socialIco twitter h-8 w-8 rounded-full absolute bottom-0 m-auto -ml-4 -mb-1"></div>
	</div>
	<!-- xAvatar and Active Social ico -->
</header>




